import React from 'react';
import { Container, Row, Col, Navbar, Nav } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Navigation() {
  return (
    <>
      <div style={{ position: 'sticky', top: 0, zIndex: 1020, backgroundColor: 'white' }}>
        <Container fluid>
          <Row>
            <Col xs={1} md={1} lg={1} xl={1} className="d-none d-md-block"></Col>
            <Col xs={12} md={10} lg={10} xl={10}>
              {/* <h1 className="text-center text-6xl">J. */}
                <Link className='j-link' to="/"><h1 className="text-center text-6xl">J.</h1></Link>
                {/* </h1> */}
            </Col>
            <Col xs={1} md={1} lg={1} xl={1} className="d-none d-md-block"></Col>
          </Row>
        </Container>
        <Navbar bg="white" variant="light">
          <Nav className="mx-auto d-flex justify-content-around">
            <Link className="nav-link" to="/NewArrivals">New Arrivals</Link>
            <Link className="nav-link" to="/Cast-and-Crew">Cast & Crew</Link>
            <Link className="nav-link" to="/Women">Women</Link>
            <Link className="nav-link" to="/Men">Men</Link>
            <Link className="nav-link" to="/Boys-and-Girls">Boys & Girls</Link>
            <Link className="nav-link" to="/Fragrances">Fragrances</Link>
            <Link className="nav-link" to="/Makeup">Makeup</Link>
            <Link className="nav-link" to="/SkinCare">Skin Care</Link>
          </Nav>
        </Navbar>
      </div>
    </>
  );
}

export default Navigation;
